import React, { Component } from "react";
import BrainPartsPath from "../assets/images/brain-parts.svg";

class BrainParts extends Component {
  render() {
    return (
      <img
        className="brain__parts--svg"
        src={BrainPartsPath}
        alt="brain-parts"
      />
    );
  }
}

export default BrainParts;
